/*Table structure for table `sira_form_htp` */

DROP TABLE IF EXISTS `sira_form_htp`;

CREATE TABLE `sira_form_htp` (
  `id` bigint(20) NOT NULL auto_increment,
  `id_adolescente` bigint(20) NOT NULL,
  `id_evaluador` bigint(20) NOT NULL,
  `id_esquema` bigint(20) NOT NULL,
  `fecha` datetime NOT NULL,
  `edadAdolescente` int(11) NOT NULL,
  `tiempoLatenciaCasa` int(11) NOT NULL,
  `tiempoLatenciaArbol` int(11) NOT NULL,
  `tiempoLatenciaPersona` int(11) NOT NULL,
  `tiempoDuracionCasa` int(11) NOT NULL,
  `tiempoDuracionArbol` int(11) NOT NULL,
  `tiempoDuracionPersona` int(11) NOT NULL,
  `dibujoCasa` longblob NOT NULL,
  `dibujoArbol` longblob NOT NULL,
  `dibujoPersona` longblob NOT NULL,
  `auditCreateDate` datetime default NULL,
  `auditUpdateDate` datetime default NULL,
  `auditCreateUser` varchar(45) default NULL,
  `auditUpdateUser` varchar(45) default NULL,
  PRIMARY KEY  (`id`),
  KEY `FK4C0A36E3B7187C7B` (`id_esquema`),
  KEY `FK4C0A36E3FD32CF31` (`id_evaluador`),
  KEY `FK4C0A36E3F019975D` (`id_adolescente`),
  CONSTRAINT `FK4C0A36E3F019975D` FOREIGN KEY (`id_adolescente`) REFERENCES `sira_persona` (`id`),
  CONSTRAINT `FK4C0A36E3B7187C7B` FOREIGN KEY (`id_esquema`) REFERENCES `sira_esquema` (`id`),
  CONSTRAINT `FK4C0A36E3FD32CF31` FOREIGN KEY (`id_evaluador`) REFERENCES `seg_usuario` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

