  `respuesta` varchar(255) NOT NULL,
  `id_formulario` bigint(20) NOT NULL,
  `id_esq_preg` bigint(20) NOT NULL,
  PRIMARY KEY  (`id`),
  KEY `FK2E1CD27F84B69BB9` (`id_formulario`),
