/*Table structure for table `web_entrada` */

DROP TABLE IF EXISTS `web_entrada`;

CREATE TABLE `web_entrada` (
  `id` bigint(20) NOT NULL auto_increment,
  `titulo` varchar(255) NOT NULL,
  `activo` tinyint(1) default NULL,
  `resumen` text,
  `descripcion` text,
  `auditCreateDate` datetime default NULL,
  `auditUpdateDate` datetime default NULL,
  `auditCreateUser` varchar(45) default NULL,
  `auditUpdateUser` varchar(45) default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `web_entrada` */

insert  into `web_entrada`(`id`,`titulo`,`activo`,`resumen`,`descripcion`,`auditCreateDate`,`auditUpdateDate`,`auditCreateUser`,`auditUpdateUser`) values (1,'View too good11111111111',1,'<p><img align=\"left\" border=\"2\" src=\"/Cmail-Vista/documentos/imagenes/views.jpg\" style=\"padding: 5px; margin-right: 5px;\" alt=\"\" /></p>\n<p><span style=\"color: rgb(0, 0, 128);\"><span style=\"font-size: large;\"><span style=\"font-family: Tahoma;\"><strong>View too good</strong></span></span></span></p>\n<p>Find safe. affordable image, video, audio</p>\n<p>from around the world.</p>\n<p>&nbsp;</p>\n<p>Wellcome to Loja..</p>\n<p>&nbsp;</p>\n<p>En este mes apreciados descuento que llegaran al maximo la tentaci&oacute;n....</p>\n<p>&nbsp;</p>\n<p>Its to</p>\n<p>&nbsp;</p>','<p><img src=\"/Cmail-Vista/documentos/imagenes/views.jpg\" style=\"width: 248px; height: 206px;\" alt=\"\" /></p>','2012-01-23 12:43:20','2012-02-02 17:13:25','adminx','admin'),(2,'Personal',1,'<p><img align=\"left\" border=\"2\" alt=\"\" src=\"/Cmail-Vista/documentos/imagenes/usersx.jpg\" style=\"padding: 5px; margin-right: 5px;\" /> <span style=\"color: rgb(0, 0, 255);\"><span style=\"font-size: x-large;\"><span style=\"font-family: Tahoma;\"><strong>Personal</strong></span></span></span></p>\n<p><span style=\"color: rgb(0, 0, 255);\"><span style=\"font-size: x-large;\"><span style=\"font-family: Tahoma;\"><strong><span style=\"font-size: medium;\"><span style=\"color: rgb(0, 51, 0);\">Se necesita contratar personal para el aseo del edificio.</span></span></strong></span></span></span></p>\n<p>Nota: Muy buena remuneraci&oacute;n</p>\n<p>Comunicarse a los telefonos 098832983923</p>\n<p>O bien escribanos a nuestro email: csacasc@hdhsa.com</p>\n<p>!10 persoas para la provincias y una para este local de la ciudad</p>\n<p>&nbsp;</p>','<p><img align=\"left\" border=\"2\" alt=\"\" src=\"/Cmail-Vista/documentos/imagenes/usersx.jpg\" style=\"padding: 5px; margin-right: 5px;\" /> <span style=\"color: rgb(0, 0, 25